Ultimate Comics: Avengers is a comic book published by Marvel Comics that began in August 2009 as part of the relaunch of the Ultimate Universe under the new &quot;Ultimate Comics&quot; imprint. The series is written by Mark Millar, creator of the Ultimates, Ultimate X-Men and co-creator of Ultimate Fantastic Four.

The series takes place in the Ultimate Universe in the weeks following the events of Ultimatum.
